import React, { Fragment, useState, useEffect } from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";

import List from "./components/pages/list";
import NewForm from "./components/pages/newForm";
import FormDetails from "./components/pages/formDetails";
import Navigation from "./components/navComponents/Navigation";

import "./App.css";

const App = () => {
  const [mode, setMode] = useState("list");

  return (
    <BrowserRouter>
      <Navigation />
      <Routes>
        <Route path="/" element={<Navigate replace to="/list" />} />
        <Route path="/list" element={<List />} />
        <Route path="/new-form" element={<NewForm />} />
        <Route path="/edit-form/:id" element={<FormDetails />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
